import React, { useState } from 'react'

function NewFile() {
    const [data,setData]=useState('My Title')
    const clickHandler=(()=>{
        setData("My new title")
    })
    return (
      <div>
          <h1 onClick={clickHandler}>{data}</h1>
          <h1>Ali Abbas</h1>
      </div>
    );
  }
  
  export default NewFile;
